import React from 'react'
import ArticleCard from 'src/components/molecules/ArticleCard'
import Box from '@material-ui/core/Box'

const ArticleArea: React.FC = () => {
  const articleCards = [1, 2, 3, 4].map((x, index) => (
    <Box component="div" display="inline" key={index.toString()}>
      <ArticleCard />
    </Box>
  ))
  return (
    <div style={{ width: '100%' }}>
      <Box component="span" m={10} display="inline">
        <ArticleCard />
        <ArticleCard />
      </Box>
    </div>
  )
}

export default ArticleArea
